angular.module("ForecastApp", [])
    .controller("WeatherServiceController", ["$scope", "$http",
        "GoogleGeolocationService", "DarkSkyWeatherService",
        function($scope, $http,
            GoogleGeolocationService,
            DarkSkyWeatherService) {

            var wsc = this;

            wsc.selected_lat = 0;
            wsc.selected_lon = 0;

           
            //App name    
            wsc.app_name = "Weather App";

            wsc.cities = [
            {
                name: "Lubbock",
                url_name: "Lubbock",
                state: "TX",
                lat: 0,
                lon: 0
            },
            {
                name: "Alaska",
                url_name: "Alaska",
                state: "AK",
                lat: 0,
                lon: 0
            }, 
            {
                name: "Ottawa",
                url_name: "Ottawa",
                state: "CA",
                lat: 0,
                lon: 0
            },
            {
                name: "New York",
                url_name: "New York",
                state: "NY",
                lat: 0,
                lon: 0
            },
            {
                name: "London",
                url_name: "London",
                state: "UK",
                lat: 0,
                lon: 0
            }
            ];

            wsc.getLatLonForSelected = function() {
                GoogleGeolocationService.geoLocate(wsc.selected_city)
                    .then(function(res) {
                        wsc.selected_lat = res.data.results[0].geometry.location.lat;
                        wsc.selected_lon = res.data.results[0].geometry.location.lng;

                        wsc.selected_city.lat = wsc.selected_lat;
                        wsc.selected_city.lon = wsc.selected_lon;

                        //var google_static_maps_key = "AIzaSyAVIugWFEfJlG9Y5HS-kkkoQISjDNWWDtM";
                        var google_static_maps_key = "AIzaSyC4tT_4VUXDbiSLz_AJVuTLDOzewjj7O9A";

                        wsc.google_static_maps_url = "https://maps.googleapis.com/maps/api/staticmap?center=" +
                            wsc.selected_lat + "," +
                            wsc.selected_lon +
                            "&zoom=10&size=600x300&key=" +
                            google_static_maps_key;

                        console.log("Google Static Map API URL");
                        console.log(wsc.google_static_maps_url);

                        //console.log(res);


                        wsc.getCurrentConditions();

                    })
                    .catch(function(err) {
                        console.log(err);
                    });
            };

            wsc.getCurrentConditions = function() {
                DarkSkyWeatherService.getCurrentConditions(wsc.selected_city)
                    .then(function(res) {
                        console.log(res);

                        //get the weather stuff from the Dark Sky service here
                        wsc.observation_time = new Date(res.data.currently.time * 1000);
                        wsc.temperature = res.data.currently.temperature;
                        wsc.dewpoint = res.data.currently.dewPoint;
                        wsc.windBearing = res.data.currently.windBearing;
                        wsc.windSpeed = res.data.currently.windSpeed;
                        wsc.summary = res.data.currently.summary;
                        wsc.picture = res.data.currently.icon;
                    })
                    .catch(function(err) {

                    })
            };

            wsc.list_selected = function() {
                wsc.getLatLonForSelected();
            }

            wsc.clearDay = 'data:image/png;base64,';
            wsc.clearNight = 'data:image/png;base64,';
            wsc.cloudy = 'data:image/png;base64,';
            wsc.fog = 'data:image/png;base64,';
            wsc.partlyCloudyDay = 'data:image/png;base64,';
            wsc.partlyCloudyNight = 'data:image/png;base64,';
            wsc.rain = 'data:image/png;base64,';
            wsc.sleet = 'data:image/png;base64,';
            wsc.wind = 'data:image/png;base64,';
            wsc.snow = 'data:image/png;base64,';
            
            
            wsc.icons = function() {
                wsc.icon = '';
                switch (wsc.picture) {
                    case "clear-day":
                        wsc.icon = wsc.clearDay;
                        break;
                    case "clear-night":
                        wsc.icon = wsc.clearNight;
                        break;
                    case "rain":
                        wsc.icon = wsc.rain;
                        break;
                    case "snow":
                        wsc.icon = wsc.snow;
                        break;
                    case "sleet":
                        wsc.icon = wsc.sleet;
                        break;
                    case "wind":
                        wsc.icon = wsc.wind;
                        break;
                    case "fog":
                        wsc.icon = wsc.fog;
                        break;
                    case "cloudy":
                        wsc.icon = wsc.cloudy;
                        break;
                    case "partly-cloudy-day":
                        wsc.icon = wsc.partlyCloudyDay;
                        break;
                    case "partly-cloudy-night":
                        wsc.icon = wsc.partlyCloudyNight;
                        break;
                    default:
                        wsc.icon = wsc.clearDay;
                }
                return wsc.icon;
            };

            wsc.selected_city = wsc.cities[0];
            wsc.getLatLonForSelected();
            //wsc.getCurrentConditions();            


        }
    ])
    .filter('fahrenheitToCelsius', function() {
        return function(f){
            var c;
            
            c = Math.round((f - 32) * 5 / 9);
            
            return c;
        };
        
        
    })
    .directive('myConditionsSpecial', ['$sce', function($sce) {

        //a reminder on naming conventions for directives: 
        //https://medium.com/@cironunesdev/angularjs-how-to-name-directives-118ac44b81d4#.idz35zby4

        /* https://docs.angularjs.org/guide/directive
        The restrict option is typically set to:

        'A' - only matches attribute name
        'E' - only matches element name
        'C' - only matches class name
        'M' - only matches comment
        */

        return {
            restrict: 'E',
            scope: true,
            templateUrl: $sce.trustAsResourceUrl('currentConditions.html')
        }
    }])
    .factory('GoogleGeolocationService', ['$sce', '$http',
        function($sce, $http) {
            //https://docs.angularjs.org/api/ng/service/$sce

            //create an empty object
            var geolocationService = {};

            //Google Maps Geocoding API key   
            var key = "AIzaSyCdGWA_W0E3cjWMMuwlaOtJAxhzBt51b40";

            geolocationService.geoLocate = function(location) {

                var address = "+" + location.name + ",+" + location.state;
                var url = "https://maps.googleapis.com/maps/api/geocode/json?address=" +
                    address + "&key=" + key;

                var trustedurl = $sce.trustAsResourceUrl(url);
                return $http.get(trustedurl);
            }

            return geolocationService;

        }
    ])
    .factory('DarkSkyWeatherService', ['$sce', '$http',
        function($sce, $http) {
            //work happens here

            var darkSkyWeatherService = {};

            //DarkSky API key
            var key = "52b35a5ff3157898e8c9a5f51620b1da";

            darkSkyWeatherService.getCurrentConditions = function(location) {

                var url = "https://api.darksky.net/forecast/" +
                    key + "/" + location.lat + "," + location.lon;

                console.log("DarkSky API URL:");
                console.log(url);

                var trustedurl = $sce.trustAsResourceUrl(url);
                return $http.jsonp(trustedurl, {
                    jsonpCallbackParam: 'callback'
                });

            }

            return darkSkyWeatherService;
        }
    ])
    .directive( "skycon", function () {
    return {
        restrict: "E",
        replace: true,
        scope: {
            icon: "=",
            size: "=",
            animated: "=",
            color: "="
        },
        link: function ( scope, element, attrs ) {

            // make a canvas for our icon
            var canvas = document.createElement( "canvas" );

            // set the CSS class from attribute
            if ( !attrs.class ) {
                canvas.className = "skycons";
            } else {
                canvas.className = attrs.class;
            }

            // set default color if "color" attribute not present
            var config = {
                color: scope.color || "black"
            };

            var skycons = new Skycons( config );

            // watch the size property from the controller
            scope.$watch( "size", function ( newVal, oldVal ) {
                if ( newVal ) {
                    canvas.height = newVal;
                    canvas.width = newVal;
                } else {
                    canvas.height = scope.size || 64;
                    canvas.width = scope.size  || 64;
                }
            }, true );

            // add the animation
            skycons.add( canvas, scope.icon );

            // watch the icon property from the controller for changes
            scope.$watch( "icon", function () {
                skycons.set( canvas, scope.icon );
            }, true );

            // watch the color property from the controller for changes
            scope.$watch( "color", function () {
                skycons.color = scope.color;
            }, true );

            if (scope.animated === "false" || scope.animated === false) {
                skycons.pause();
            }
            else {
                skycons.play();
            }

            if ( element[0].nodeType === 8 ) {
                element.replaceWith( canvas );
            } else {
                element[0].appendChild( canvas );
            }

            scope.$on("$destroy", function () {
                skycons.remove(canvas);
                if (skycons.list.length === 0) {
                    skycons.pause(canvas);
                }
            });
        }
    };
} );


